        <div className="GraphicDesign">
            <h1 className="fw-bold text-capitalize" style={{fontFamily: "Chakra Petch, sans-serif"}}>Graphic design</h1>
            <div className="d-flex" style={{gap: 150}}>
                <div className="col-lg-7">
                    <Checklist
                        title="Beautiful Typography"
                        descriptions="Euismod tincidunt ut laoreet dolore magna
                                aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud"/>
                    <Checklist
                        title="Eco Friendly"
                        descriptions="Euismod tincidunt ut laoreet dolore magna
                                aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud"/>
                </div>
                <div className="col-lg-5 dog"/>
                {/*<div className="col-lg">
                    <img src={image} alt="#" width={500}/>
                </div>*/}
            </div>

        </div>
    )
};
